import './Navbar.css';
import botao from './botao.png';

function NavBar() {
  return (
    <div className="Navbar">
      <h3>GAME</h3>
      <button type="button"></button>
      <img src={botao} alt="" width="36" height="36"/>
    </div>
  );
}

export default NavBar;
